import React from 'react'
import styled from 'styled-components'

const Iletisim = () => {
  return (
    <Section>
      <Card>
        <h1>İletişim Bilgileri</h1>
        <p>Adres</p>
        <p>Telefon Numarası</p>
        <p>E-posta</p>
      </Card>
      <Cardiki>
        h1
      </Cardiki>


    </Section>
  )
}

const Section = styled.section`
  display: flex;
  gab: 10px;
  margin-top: 30px;
  margin-bottom: 30px;
`

const Card = styled.div`
    flex: 1;
    text-align: center;
    border: solid 1px gray;
    background-color: #494e4e;
    color: white;
    padding: 10px;
    border-radius: 10px;
`
const Cardiki = styled.div`
    flex: 3;
    text-align: center;
    border: solid 1px gray;
    background-color: #494e4e;
    color: white;
    padding: 10px;
    border-radius: 10px;
`

export default Iletisim
